const NotoSansRegular = `@font-face { font-family: 'Noto Sans'; font-style: normal; font-weight: 400; src: local('Noto Sans'), local('NotoSans'), url('data:font/woff2;base64,') format('woff2'); }`;
const NotoSansItalic = `@font-face { font-family: 'Noto Sans'; font-style: italic; font-weight: 400; src: local('Noto Sans Italic'), local('NotoSans-Italic'), url('data:font/woff2;base64,') format('woff2'); }`;
const NotoSans700 = `@font-face { font-family: 'Noto Sans'; font-style: normal; font-weight: 700; src: local('Noto Sans Bold'), local('NotoSans-Bold'), url('data:font/woff2;base64,') format('woff2'); }`;
const NotoSans700italic = `@font-face { font-family: 'Noto Sans'; font-style: italic; font-weight: 700; src: local('Noto Sans Bold Italic'), local('NotoSans-BoldItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
